import { Fragment } from "react";
import FacturasTemplates from "./Pages/FacturasPage";
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter } from "react-router-dom";

const App = () => {
  return (
    <Fragment>
      <BrowserRouter>
        <FacturasTemplates />
      </BrowserRouter>
    </Fragment>
  );
};

export default App;
